import '../style/App.css';
import Header from './Header';
import Mecze from './Mecze';
import Obstawianie from './Obstawianie';
import Footer from './Footer';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
      <Header />
        <Routes>
          <Route path='/ChampionsLeague' element={<Mecze competition='competition=UEFA%20Champions%20League&page=1'/>} />
          <Route path='/PremierLeague' element={<Mecze competition='English%20Premier%20League'/>} />
        </Routes>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
